import React from 'react'
import { Wrapper } from '../../styled/general'

import {Menu, MenuTitle, Burgers} from './homestyled'

export default function index() {
    return (
        <Wrapper>
            <Menu>
                <MenuTitle></MenuTitle>
                <Burgers>
                    {[1,2,3,4].map(el => {
                        return (
                            <span key={el}>{el}</span>
                        );
                    })}
                </Burgers>
            </Menu>
        </Wrapper>
    )
}
